import '../scss/body.scss'
import Menu from "../AddComponents/Menu";
import Operation from "../AddComponents/Operation";
import '../App.scss'

class Body extends Component {
    render() {
        return (
            <div className='body'>
                <header className="App-header">
                    <div className='title'>
                        <h1> Ben venuto su  <span>Converzione</span></h1>
                    </div>
                </header>
                <Menu />
                <Operation />
            </div>
        );
    }
}

export default Body;
